// import { data } from 'autoprefixer'
import React from 'react'
import useProducts from './data/useProducts'

export default function App() {
  const products = useProducts()
  const product = null;
  if (products !== null) {
    product  = products
  }
  return (
    <div>
      App
      <ul>
        {
          product.map(item => (
            <li key={item.id}>{item.name}</li>
          ))
        }
      </ul>
    </div>
  )
}
